style:
#resumecv-layout {
   width: 100%;
   max-width: 210mm;
   background: #ffff;
   padding: 0;
     box-shadow: 0 3px 1px -2px rgba(0,0,0,.2), 0 2px 2px 0 rgba(0,0,0,.14), 0 1px 5px 0 rgba(0,0,0,.12);

   
 }
 
 #resumecv-main{
 
 font-size: 14px;line-height: 24px;
 display: flex;
 flex-wrap: nowrap;
 background-color: #fff;

 }
 
 #rb-left .resumecv-block{
 margin-bottom: 30px
 }
 
 #rb-left {
   width: 30%;
   padding:30px 30px 30px 30px;
   background: #fff!important;
   

 }
 #resumecv-content {
   width: 70%;
   background: #fff;
   margin-top: 80px;

 }
 
 
 #rb-left-top h1 span{
 display:block
 }
 
 #rb-left-top h2{
 margin:0;
 font-size: 16px;
 font-weight: normal;
 margin-bottom: 12px;
 text-align: left;
   font-style: italic;
   font-weight: 600;
   color:#383838;

 }
 
 #rb-left-top h1{
   color:#383838;
 font-size: 28px;	
 margin:0;
 line-height: normal;
 text-transform: uppercase;
 text-align: left;
   font-weight: 700;
padding-bottom: 10px;
 
 }
 
 #resumecv-content .resumecv-block {
   position: relative;
   padding: 5px 10px;
 }
 #rb-left .resumecv-box-content {
 padding-bottom: 0;
 margin:0;
 }
 .skill{
 margin-top: 15px
 }
 
 
 .box-name p{		
   overflow: hidden;
 }
 .box-name{		
 overflow: hidden;
 background: #2f3a40;
 }
 #resumecv-content p{
 margin-bottom: 5px
 }
 #rb-left .h3{
  color:#383838;

 font-size: 18px;
   font-weight: bold;
   margin-top: 0;
   text-transform: uppercase;
   
   text-align: left;
 }
 #resumecv-content .head{
   font-size: 18px;
   color: #383838;
   padding-bottom: 5px;
   /* border-bottom: 2px solid #9B9C8F; */
   font-weight: bold;
   margin-top: 0;
   text-transform: uppercase;
 }
 
 
 #resumecv-content h3{
   font-weight:bold;font-size: 14px;line-height:30px;margin-bottom: 10px;color: #333;
 }
 
 #resumecv-content span{
 display: inline-block;
 padding-right: 15px;
 padding-left: 15px;
 }
 
 #rb-left .h3:first-child{
 margin-top: 0
 }
 .resumecv-box-content{
 margin-bottom: 25px;
 padding-left: 15px;
 position: relative;
 }
 
 #resumecv-box-ava{	
 margin-bottom: 10px; auto;
 }
 #resumecv-box-ava img{
 padding: 0;
 border:0;
 width: 150px;
 height: 150px;
 border-radius: 50%;
 
 }
 .bar-exp span {
   display:block;
   height: 8px;
   background: #d9d9d9;
 }
 .bar-exp{
 background: #2f3a40;
 border: solid 2px white;
   margin-bottom: 12px;
 }
 .icoweb label{
 display: block;
 color:#627e88;
 }
 .icoweb span{
 display: block;
 }
 
 .box-contact{
 font-size: 13px;
 padding-top:0px;
 }
 
 .icoweb i.fa, .icoweb i.fab, .icoweb i.far{
   width: 20px;
   height: 20px;
   background-color:#333;
   border-radius: 50%;
   -webkit-border-radius: 50%;
   -moz-border-radius: 50%;
   display: inline-block;
   text-align: center;
   font-size: 13px;
   line-height: 20px;
   color: #fff!important;
   margin-right: 10px;
   margin-top: 3px;float:left
 }
 .head i{
   font-size: 25px;
   margin-right: 10px;
 }
 .exp-content{
 padding-left: 15px;
 }
 #resumecv-content span.exp-date {
   float: right;
 }
 .icon_fa{
 text-align: center;
 }
 .icon_fa i.fa{
 font-size: 20px;
 border: solid 1px #ffffff;
 border-radius: 50%;
 padding: 5px;
 width: 20px;
 color: white;
 background: #ffffff;
 margin-bottom: 5px;
 }
 p.head i.fa{float:left}
 .rb-skillrate-value[value="1"]{width:20%}
 .rb-skillrate-value[value="2"]{width:40%}
 .rb-skillrate-value[value="3"]{width:60%}
 .rb-skillrate-value[value="4"]{width:80%}
 .rb-skillrate-value[value="5"]{width:100%}
 span.date{font-weight:normal;font-style:italic;padding:0 10px;float:right}
.resumecv-box-content-skill span.fa {
    margin-right: 8px;
    font-size: 18px;
}
.resumecv-box-content-skill span.fa.checked {
    color: #FFC531;
}
